//CSS import
import './CSS/App.css';
import React from 'react';
import {
  //MemoryRouter as Router,
  BrowserRouter as Router,
  Switch,
  Redirect,
  Route
} from "react-router-dom";
import MainPage from './Pages/MainPage';
import ChosenCardsPage from './Pages/ChosenCardsPage';
import CategoryPage from './Pages/CategoryPage';
import AnimationPage from './Pages/AnimationPage';
import NotFoundPage from './Pages/NotFoundPage';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path='/stuartgo/' component={MainPage} />
          <Route exact path='/stuartgo/cards' component={ChosenCardsPage} />
          <Route exact path='/stuartgo/categories' component={CategoryPage} />
          <Route exact path='/stuartgo/animation' component={AnimationPage} />
          <Route exact path="/stuartgo/404" component={NotFoundPage} />
          <Redirect to="/stuartgo//404" />
        </Switch>
      </Router>
    </div >
  );
}

export default App;
